import React from "react";
import "../style.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  let date = new Date();
  let year = date.getFullYear();
  return (
    <Container fluid className="footer">
      <Row>
        <Col md="4" className="footer-copywright">
          <h3>Designed and Developed by Ajay kumar</h3>
        </Col>
        <Col md="4" className="footer-copywright">
          <h3>Copyright Â© {year} AJ</h3>
        </Col>
        <a className="btn btn-social-icon btn-instagram" href="https://www.instagram.com/ajay__kum__ar_/"><i className="fa fa-instagram"></i></a>
         <a className="btn btn-social-icon" href="mailto:ajay19293@iiitd.ac.in"><i className="fa fa-envelope-o"></i></a>
          <a className="btn btn-social-icon btn-linkedin" href= "https://www.linkedin.com/in/ajay-kumar-a5bb4b193/" > <i className="fa fa-linkedin">  </i></a>
      </Row>
    </Container>
  );
}

export default Footer;
